import requests
from bs4 import BeautifulSoup
import base64
import os

class ReverseImageSearch:

    def __init__(self):
        self.searchUrl = 'http://www.google.hr/searchbyimage/upload'

    def convert_binary_to_image(self):
        import base64
        with open("images\\su.PNG", "rb") as img_file:
            image_file = base64.b64encode(img_file.read())

        print(image_file)
        return image_file

    def decode_image(self,imgstring=None):
        #imgstring = ''
        imgdata = base64.b64decode(imgstring)
        filename = 'test.jpg'  # I assume you have a way of picking unique filenames
        with open(filename, 'wb') as f:
            f.write(imgdata)
        return filename


    def fetch_title(self, file_path=None):
        multipart = {'encoded_image': (file_path, open(file_path, 'rb')), 'image_content': ''}
        response = requests.post(self.searchUrl, files=multipart, allow_redirects=False)
        fetch_url = response.headers['Location']
        print(fetch_url)
        headers = {
            'User-Agent': 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/39.0.2171.95 Safari/537.36'
        }
        title_name = ""


        response = requests.get(fetch_url, headers=headers)
        soup = BeautifulSoup(response.text, 'lxml')
        title_name = soup.select_one('input[name=q]')['value']
        print(title_name)


        # try:
        #     os.remove(os.getcwd()+"\\" file_path)
        #     print("======image file has been removed============")
        # except Exception as ex:
        #     os.remove(file_path)
        #     print(ex)

        return title_name
